import React, {useEffect,useState} from "react";
import yfinance from "yfinance";
import NavBar from "./NavBar";
import {Routes, Route} from "react-router-dom";

function Dashboard () {

    const [top10IndianStocks, setTop10IndianStocks] = useState([]);

    useEffect(() => {
        const getTop10IndianStocks = async () => {
            const data = await yfinance.quoteTable(["^BSESN"], { region: "IN" });
            const top10 = Object.keys(data).slice(1, 11);
            setTop10IndianStocks(top10);
        };

        getTop10IndianStocks();
    }, []);

    return(
        <>
            <div className="Navbar-dashboard">
                <NavBar/>
            </div>
            <div>
                <h1>Top 10 Indian Stocks</h1>
                <ul>
                    {top10IndianStocks.map((stock) => (
                        <li key={stock}>{stock}</li>
                    ))}
                </ul>
            </div>
        </>


    );
}

export default Dashboard;
